import React, { Component } from 'react';
import { withRouter } from 'react-router-dom';
import { MuiThemeProvider, createMuiTheme } from '@material-ui/core/styles';
import { InputBase, Card, Tooltip, TextField, CardContent } from '@material-ui/core';
const themes = createMuiTheme({
    overrides: {
        MuiPaper: {
            rounded: {
                borderRadius: "8px",
                margin: "10px"
            },
            elevation24: {
                boxShadow: "none"
            }
        },
        MuiBackdrop: {
            root: {
                backgroundColor: "rgba(15,15,15,0.25)"
            }
        }
    }
})
class SearchNote extends Component {
    constructor(props) {
        super(props)
        this.state = {
            notes:this.props.elasticSearch
        }
    }   
    render() {
       console.log(this.state.notes)
        return (
            <div className="note-display">
                  <MuiThemeProvider theme={themes}>
                {this.props.find ? <Card  >
                    <CardContent>
                        { this.props.find  }
                    </CardContent>
                    <CardContent>
                        { this.props.again  }
                    </CardContent>
                     </Card> : ''}
                </MuiThemeProvider>

            </div>
        )
    }
}
export default withRouter(SearchNote)
